import React, { useEffect, useState } from "react";

const LifeCycle = () => {
  const [count, setCount] = useState(0);
  const [text, setText] = useState("");

  return (
    <div style={{ padding: 20 }}>
      <div>
        {count}
        <button
          onClick={() => {
            setCount(count + 1);
          }}
        >
          +
        </button>
        <div>
          <input
            value={text}
            onChange={(e) => {
              e.target.value;
            }}
          ></input>
        </div>
      </div>
    </div>
  );
};

export default LifeCycle;
